	unlockCraft(type){
		for(let i of Object.keys(fishCraft[type].price)){
			if(fishCraft[type].price[i]>this.paper[i])return;
		}
		this.craftUnlocked.push(fishCraft[type].type);
		for(let i of Object.keys(fishCraft[type].price)){
			this.paper[i] -= fishCraft[type].price[i];
		}
		this.viewPaper();
	}

